import React from "react";
import ReactDOM from "react-dom";
import "./index.css";

let crnDate = new Date(2021,18,13,5);
crnDate = crnDate.getHours();
let greeding = "";
let cssStyle = {};

if (crnDate >= 1 && crnDate < 11 ) {
  greeding = "Good Morning";
  cssStyle.color = "green";
}else if (crnDate >= 12 && crnDate < 19 ){
  greeding = "Good Afternon";
  cssStyle.color = "blue";
}else{
  greeding = "Good Night";
  cssStyle.color = "black";

}

ReactDOM.render(
  <>
  <h1>Hello, <span style = {cssStyle}>{greeding}</span> </h1>
  </>,

  document.getElementById("root")
)
